(218, 'DENY_USER_SIGNUP', '{"es":"Denegar registro de usuario en el sistema","en":"DENY_USER_SIGNUP"}', '{"es":"Dependiendo que como est\\u00e1n configuradas las preferencias globales del sistema, esta operaci\\u00f3n es ejecutada cuando un usuario se registra el sistema pero a\\u00fan no le est\\u00e1 permitido ingresar, y depende de un administrador validar o impedir tal registro.","en":"DENY_USER_SIGNUP"}', '', '1'),
(219, 'UPDATED_ACCOUNT_RECOVERING_MECHANISM', '{"es":"Modificar mecanismo de recuperaci\\u00f3n de cuenta","en":"UPDATED_ACCOUNT_RECOVERING_MECHANISM"}', '{"es":"En el panel de configuraciones globales, se escoge el mecanismo a desplegar cuando un usuario decide recuperar el acceso a su cuenta, ya sea porque olvid\\u00f3 la contrase\\u00f1a o por otras razones, se puede configurar para enviar un link de recuperaci\\u00f3n o enviarle una nueva contrase\\u00f1a (aleatoria o definida a mano por el administrador que ejecute la recuperaci\\u00f3n).","en":"UPDATED_ACCOUNT_RECOVERING_MECHANISM"}', '', '1'),
(220, 'UPDATED_ACCOUNT_RECOVERING_MECHANISM_AUTOMATIC', '{"es":"Auomatizar mecanismo de recuperaci\\u00f3n de cuenta de usuario","en":"UPDATED_ACCOUNT_RECOVERING_MECHANISM_AUTOMATIC"}', '{"es":"Escoge la opci\\u00f3n de automatizar mecanismo de recuperaci\\u00f3n de cuenta, enviando un correo con link de recuperaci\\u00f3n de cuenta al correo del usuario","en":"UPDATED_ACCOUNT_RECOVERING_MECHANISM_AUTOMATIC"}', '', '1'),
(221, 'DENY_ACCOUNT_RECOVERING', '{"es":"Denegar petici\\u00f3n de recuperaci\\u00f3n de cuenta","en":"DENY_ACCOUNT_RECOVERING"}', '{"es":"En caso de que no est\\u00e9 configurada la recuperaci\\u00f3n de cuenta como mecanismo autom\\u00e1tico, queda a voluntad de alg\\u00fan administrador autorizado si aceptar o no la petici\\u00f3n del usuario de recuperar cuenta, en esta operaci\\u00f3n se niega.","en":"DENY_ACCOUNT_RECOVERING"}', '', '1'),
(222, 'PROCCESS_ACCOUNT_RECOVERING', '{"es":"Procesar petici\\u00f3n de recuperaci\\u00f3n de cuenta","en":"PROCCESS_ACCOUNT_RECOVERING"}', '{"es":"El administrador procesa manualmente la solicitud de recuperaci\\u00f3n de cuenta del usuario","en":"PROCCESS_ACCOUNT_RECOVERING"}', '', '1'),
(223, 'READ_PRODUCT_STRUCTURE', '{"es":"Obtener estructura de plantilla de producto\\/servicio","en":"READ_PRODUCT_STRUCTURE"}', '{"es":"Obtener estructura de plantilla de producto\\/servicio, para luego mostrarla en la interfaz correspondiente","en":"READ_PRODUCT_STRUCTURE"}', '', '1'),
(224, 'UPDATE_GENERAL_SESSION_DURATION', '{"es":"Actualizar duraci\\u00f3n m\\u00e1xima por defecto de sesi\\u00f3n de usuario","en":"UPDATE_GENERAL_SESSION_DURATION"}', '{"es":"Actualizar duraci\\u00f3n m\\u00e1xima por defecto de sesi\\u00f3n de usuario, el valor escogido ser\\u00e1 asignado a cada nuevo usuario registrado posterior a la modificaci\\u00f3n","en":"UPDATE_GENERAL_SESSION_DURATION"}', '', '1'),
