(2283, 327, 'str_admin_terms_desc_3', '{"es":"","en":""}', '{"es":"","en":""}', '{"es":"se puede administrar la biblioteca de los mismos asociados a cada secci\\u00f3n. Al instalar el sistema ya existe un conjunto predeterminado de t\\u00e9rminos con las traducciones correspondientes a los idiomas disponibles. B\\u00e1sicamente todo el texto que se ve en la interfaz est\\u00e1 disponible en otros idiomas (especificados en la instalaci\\u00f3n), y solo es cuesti\\u00f3n de cambiarlo con un solo click (en la parte superior, la opci\\u00f3n de \\"Configuraciones\\"), o editar la biblioteca de t\\u00e9rminos a conveniencia.","en":"can be managed the set of terms associated with each section. After installing the system there is already a terms set by default with their translations to each one of the languages available in the system. In other words, all the text seen in the interface can be availabe in other languages as well, The navigation language can be changed in the top section, clicking \\"Settings\\", or editing the translations in the corresponding access."}'),
(2284, 327, 'str_admin_terms_desc_4', '{"es":"","en":""}', '{"es":"","en":""}', '{"es":"Para editar los t\\u00e9rminos de una secci\\u00f3n, haga click en el enlace de la secci\\u00f3n (esto mientras est\\u00e9 navegando en el acceso","en":"To edit the terms of a section or access (are synonymous here), click the section link (do this when you are navigating in the access"}'),
(2285, 327, 'str_admin_terms_desc_5', '{"es":"","en":""}', '{"es":"","en":""}', '{"es":"Se desplegar\\u00e1 un modal con todos los t\\u00e9rminos disponibles para esa secci\\u00f3n. El texto que se muestra en la interfaz final es el de la columna \\"Valor\\", y recomendamos no cambiar el texto de la columna \\"C\\u00f3digo\\".","en":"A modal or lightbox will be shown with all the terms availables for that section. The text shown in the final interface can be located in the column \\"Value\\",  and it''s rcommended not changing the text of the column \\"Code\\"."}'),
(2286, 327, 'str_admin_terms_desc_6', '{"es":"","en":""}', '{"es":"","en":""}', '{"es":"Como se ha mencionado m\\u00e1s arriba, cada acceso posee una vista asociada, en un archivo","en":"Each access has a view associated, in a file"}'),
